   public PostInfo  getdata(String tag){
        postInfo=new PostInfo();
        if(this.newslist==null){
          return null;
        }
        postInfo.setCount(this.newslist.size()+"");
       ArrayList<PostInfo.InfoBean> postinfobeanlist=new ArrayList<>();
       for (NewslistBean b:newslist
            ) {
        PostInfo.InfoBean bean=new PostInfo.InfoBean();
        bean.setCreateTime(b.getTime());
        bean.setItemAuthor(b.getChlname());
        bean.setItemDomain(tag);
        bean.setItemType("1");
        bean.setItemTitle(b.getTitle());
        bean.setItemSource(b.getSource());
        bean.setItemUrl(b.getUrl_comment());
        bean.setItemComment(b.getCommentNum()+"");
        bean.setItemRead(b.getViewNum()+"");
        postinfobeanlist.add(bean);
       }
       postInfo.setInfo(postinfobeanlist);
       return postInfo;
    }
